import React, { Component } from 'react';
import MuiThemeProvider from 'material-ui/styles/MuiThemeProvider';
import RaisedButton from 'material-ui/RaisedButton';

import {lightBlue600} from 'material-ui/styles/colors';

import './App.css';


import Title from "./components/Title";

class App extends Component {
  render() {
    return (
      <MuiThemeProvider>
        <div className="Header-background">
          <div style={{"width":"80%","margin":"0 auto"}}>
            <div className="Header-main">
              <Title></Title>
              <RaisedButton label="Crear cuenta" primary={true}/>
              <img className="Header-ilustration" src={process.env.PUBLIC_URL + './images/bg-geo.png'} />
            </div>
            <div style={{'background-color': lightBlue600}}>
              <ul>
                <li>
                  <h3>Califica con emociones</h3>
                  <p>Califica con experiencias no con numeros</p>
                </li>
                <li>
                  <h3>¿Sin internet?, ¡No hay problema!</h3>
                  <p>Places funciona sin internet o en cconexiones lentas</p>
                </li>
                <li>
                  <h3>Lugares favoritos </h3>
                  <p>Define tus lugares preferidos</p>
                </li>
              </ul>
            </div>
          </div>
        </div>
      </MuiThemeProvider>
    );
  }
}

export default App;
